// src/App.js

import React from 'react';
import Navbar from '../../Navbar';

const App = () => {
  return (
    <div>
      <Navbar />
      <h1>Welcome to MyApp</h1>
      <p>This is a simple Navbar component.</p>
    </div>
  );
};

export default App;
